file_samples = {}
for path in file_paths:
    try:
        with open(path, &#x27;r&#x27;, encoding=&#x27;ISO-8859-1&#x27;) as file:
            lines = [next(file) for _ in range(5)]
            file_samples[path] = lines
    except Exception as e:
        file_samples[path] = [f&quot;Error: {e}&quot;]

